import { useState } from 'react';
import './App.css';
import ColorBox from './ColorBox';
import SearchColor from './SearchColor';

function App() {

  const [textColor, setTextColor] = useState('black')
  const [color, setColor] = useState([
    {
      color: 'red',
      hex:'#fa3243'
    },
    {
      color: 'red',
      hex:'#fa3243'
    },
    {
      color: 'red',
      hex:'#3232fa'
    }
  ])
  const handleToggle = () => {
    if (textColor === 'black') {
      setTextColor('white')
    } else {
      setTextColor('black')
    }
  }

  return (
    <div className="App">
      <header className="App-header">
        <ColorBox textColor={textColor} />
        <SearchColor
          handleToggle={handleToggle}
        />
      </header>
    </div>
  );
}

export default App;
